      &::before {
        display: inline-block;
        content: '';
        width: 0%;
        height: 2px;
        background-color: #002053;
        position: absolute;
        bottom: 0;
        left: 50%;
        transition: .3s;
      }
  
      &::after {
        display: inline-block;
        content: '';
        width: 0%;
        height: 2px;
        background-color: #002053;
        position: absolute;
        bottom: 0;
        right: 50%;
        transition: .3s;
      }
    }
