    .swiper-slide {
      width: 1000px;
      height: 600px;
  
      /* display: flex; */
      background: #002053;
      opacity: 0.3;
      align-items: center;
      justify-content: center;
      transition: all 0.2s ease-in;
      transform: scale(0.8);
      margin: 0 50px;
      color: black;
      font-size: 30px;
  
      &.swiper-slide-active {
        transform: scale(1);
        background: lightsteelblue;
        opacity: 1;
      }
    }
  
    .swiper-button-next {
      top: 50%;
      transform: translateY(-50%);
      left: auto;
      right: 20%;
      color: black;
      border: 0;
    }
  
    .swiper-button-prev {
      color: black;
      top: 50%;
      transform: translateY(-50%);
      left: 20%;
      border: 0;
    }
  
    .swiper-button-next:after, .swiper-button-prev:after {
      font-size: 50px;
      border: 0;
    }
  
    .swiper-slide .new_wrap {
      display: flex;
  
