        width: 60%;
        font-size: 0;
  
        img {
          width: 100%;
          height: auto;
        }
      }
  
      .new_text {
        width: calc(100% - 60% - 20px);
        margin-left: 20px;
  
        h4, p {}
      }
    }
  }
  
